import React from 'react';
import { Carousel } from "react-responsive-carousel";

export default() => {
    <Carousel autoPlay>
        <div>
            <img alt="" src="http://klikeraj.hr/wp-content/uploads/2018/02/Picture1.png" />
            <p className="legend">Legend1</p>
        </div> 
        <div>
            <img alt="" src="https://az.medzlistuzla.ba/podaci/2011/03/zaboravljanje.png" />
            <p className="legend">Legend1</p>
        </div>

    </Carousel>
};
